import React from "react";
import { Button, Grid, TextField, Stack, Container } from "@mui/material";
import "./index.css";

function Login() {
  return (
    <Stack
      direction="column"
      justifyContent="center"
      alignItems="center"
      spacing={2}
    >
      <TextField
        fullWidth
        id="outlined-basic"
        label="Username"
        variant="outlined"
      />
      <TextField
        fullWidth
        id="outlined-password-input"
        label="Password"
        type="password"
      />
      <Button fullWidth variant="contained">
        Login
      </Button>
    </Stack>
  );
}

export default Login;
